import { Component, OnInit } from '@angular/core';
import * as jsPDF from 'jspdf';
import 'jspdf-autotable';
@Component({
  selector: 'ngx-test-export',
  templateUrl: './test-export.component.html',
  styleUrls: ['./test-export.component.scss']
})
export class TestExportComponent {

  constructor() { }


  public exportAsPDF(reportTitle: string, header: any[][], tableColumn:any, body:any, isLandscap: boolean): void {
    //var imgData = "src/assets/images/feat02.jpeg";    
    const doc = isLandscap ? new jsPDF('l','pt'): new jsPDF();
    
    let colSpan :number = header.length == 0 ? 1 : header[0].length;

    let _topHeader:any[]=[[
      {
        content: reportTitle,
        colSpan: colSpan,
        rowSpan: 1,
        styles: {
          valign: 'middle',
          halign: 'center',
          fontSize: 14,
          fontStyle: 'bold'
        }
      },""
    ]];
    header.forEach(element => {
      _topHeader.push(element);      
    });
// need jspdf version 3.5.22
    //doc.background

    //ndoc.addImage(imgData, 'JPEG', 15, 40, 180, 160);

    doc.autoTable({
      margin: { top: 20 },
      body: _topHeader
    });

    doc.autoTable({
      columnStyles: { },
      body: body,
      columns: tableColumn,
    });

    doc.autoTable({
      html: '#table',
      didDrawCell: function(){
        doc.addImage(imgsrc, 10, 120, 80, 40)
      }
    });

    var imgsrc="data:image/jpeg;base64,"
    // doc.autoTable({
    //   body: doc.addImage(imgData, 'JPEG', 15, 40, 180, 160)
    // })

    doc.save(reportTitle.indexOf('.pdf') !== -1 ? reportTitle : reportTitle + '.pdf');
  }

}
